window.bookSummaryJSON = "<p><b>With the invasion of Earth handled, and an enemy Chosen now targeting him, Jake makes his final push for C-grade…</b></p> <p>A final push that includes refining one last skill before he evolves. Once that’s done, all he needs is a few more levels and to finish off his bucket list of vanities before it’s time to evolve.</p> <p>The evolution itself will have no surprises, right?</p> <p>Jake will no doubt learn more about himself in his quest to explore his own abilities, and of course some things don’t go entirely as expected…but little does Jake know just how much his happy little accidents can send tremors through the multiverse and the impact it can have.</p> <p>Who knows, maybe the waves are big enough that it’s time to finally have a proper Chosen Ceremony, officially embracing his title as the Chosen of the Malefic Viper.</p> <p><b>Book 9 of hit Primal Hunter LitRPG series is here.</b> Grab your copy today!</p> <p>About the Series: Experience an Apocalypse LitRPG with levels, classes, professions, skills, dungeons, loot, and all of the great traits of progression fantasy and LitRPG that you've come to expect. Follow Jake as he explores this new vast multiverse filled with challenges and opportunities. As he grows in power and slowly transforms from a bored office worker to a true apex hunter.</p>"; 
